            "{\"data\":[{\"id\":\"3gNrHyR\",\"title\":\"Somebody please fill me in here\",\"description\":null,\"datetime\":1451269460,\"type\":\"image/png\",\"animated\":false,\"width\":610,\"height\":598,\"size\":610785,\"views\":1971,\"bandwidth\":1203857235,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"account_url\":\"JustHereToFavorite\",\"account_id\":7072412,\"comment_preview\":null,\"topic\":\"Funny\",\"topic_id\":2,\"link\":\"http://i.imgur.com/3gNrHyR.png\",\"comment_count\":17,\"ups\":23,\"downs\":8,\"points\":15,\"score\":15,\"is_album\":false},{\"id\":\"t8BFtut\",\"title\":\"I\'m venting my fucking shit feelings\",\"description\":\"Sorry for the wall of text. \n\nAs background, I am nearly 25 years old. My emotional needs have never been met in my life. I have never had a real job. Almost every time I try, I am ignored. I have never had a girlfriend, ever. I have never shared love with somebody. Women ignore me, they always just stop communicating with me with no warning, if they talk to me in the first place. The more I get rejected, the more it hurts. I am going to die lonely and miserable, completely unfulfilled. \n\nIn 2014, I made the resolution that if I failed at college, I would hang myself. I failed of course but I had decided it would be too hard on my family if I died.\n\nEarlier this year, I experimented with self-mutilation. It was cathartic and made me feel okay for a few days afterwards, if a little ashamed about it. I stopped because I was worried about the prospect of somebody seeing the scars and giving me a hard time. Some days, like today, I still want to do it.\n\nI can't talk to my parents about it. As soon as I mention that I have problems with myself they get upset and I can't deal with it. I tried talking to the psychologist, but I got too embarrassed about it. I basically pretended it was less of a problem than it is, and ended up trying to fix a small aspect of my problem. The furthest I ever went was telling my doctor that I sometimes wish I wasn't here. I never went into the self mutilation or crying or any of that shit. \n\nI see the kind of guys that are successful in life. They are just basically superior to me in every way. I am an evolutionary failure, and the fact that I am even alive is a miracle of modern society. 100 years ago I would probably have died as a baby or child. \n\nTL;DR I fucking hate myself, and if I could press a button to just erase my shitful existence without consequence, I would smash it in a goddamn heartbeat. I\'m too embarrassed to get professional help so I spill my problems anonymously on the internet.\",\"datetime\":1451283369,\"type\":\"image/png\",\"animated\":false,\"width\":528,\"height\":480,\"size\":385334,\"views\":1131,\"bandwidth\":435812754,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"account_url\":\"LivingGarbage\",\"account_id\":28611061,\"comment_preview\":null,\"topic\":\"No Topic\",\"topic_id\":29,\"link\":\"http://i.imgur.com/t8BFtut.png\",\"comment_count\":28,\"ups\":17,\"downs\":10,\"points\":7,\"score\":7,\"is_album\":false},{\"id\":\"y4Qw3pi\",\"title\":\"#nocringemomentspls\",\"description\":null,\"datetime\":1451148010,\"type\":\"image/png\",\"animated\":false,\"width\":460,\"height\":480,\"size\":458680,\"views\":564454,\"bandwidth\":258903760720,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"AdviceAnimals\",\"account_url\":\"TheEnaxion\",\"account_id\":15232761,\"comment_preview\":null,\"topic\":\"No Topic\",\"topic_id\":29,\"link\":\"http://i.imgur.com/y4Qw3pi.png\",\"comment_count\":567,\"ups\":7041,\"downs\":233,\"points\":6808,\"score\":7089,\"is_album\":false},{\"id\":\"C1S8kWn\",\"title\":\"*facepalm*\",\"description\":\"she also calls C3PO 'gold guy' and Kylo Ren 'Ran'... but she's cute, so that's nice\",\"datetime\":1451279680,\"type\":\"image/png\",\"animated\":false,\"width\":576,\"height\":577,\"size\":217660,\"views\":1568,\"bandwidth\":341290880,\"vote\":null